import React from "react";
import { motion } from "framer-motion";
import {
  IconBrandCss3,
  IconBrandGithub,
  IconBrandHtml5,
  IconBrandJavascript,
  IconExternalLink,
  IconBrandReact,
  IconBrandNodejs,
  IconBrandBootstrap,
  IconBrandFirebase,
  IconSchool,
} from "@tabler/icons-react";
import projectsData from "../../../utils/projects";

function MyProjects() {
  const renderTechStackIcons = (techStack) => {
    const skillIcons = {
      HTML5: (
        <div style={{padding: "5px", backgroundColor: "red", borderRadius: "5px", color:"white"}}>
          <IconBrandHtml5 size={24} strokeWidth={2} />
        </div>
      ),
      CSS3: (
        <div style={{padding: "5px", backgroundColor: "red", borderRadius: "5px", color:"white"}}>
          <IconBrandCss3 size={24} strokeWidth={2} />
        </div>
      ),
      JavaScript: (
        <div style={{padding: "5px", backgroundColor: "red", borderRadius: "5px", color:"white"}}>
          <IconBrandJavascript size={24} strokeWidth={2} />
        </div>
      ),
      "React.js": (
        <div style={{padding: "5px", backgroundColor: "red", borderRadius: "5px", color:"white"}}>
          <IconBrandReact size={24} strokeWidth={2} />
        </div>
      ),
      "Node.js": (
        <div style={{padding: "5px", backgroundColor: "red", borderRadius: "5px", color:"white"}}>
          <IconBrandNodejs size={24} strokeWidth={2} />
        </div>
      ),
      Bootstrap: (
        <div style={{padding: "5px", backgroundColor: "red", borderRadius: "5px", color:"white"}}>
          <IconBrandBootstrap size={24} strokeWidth={2} />
        </div>
      ),
      Firebase: (
        <div style={{padding: "5px", backgroundColor: "red", borderRadius: "5px", color:"white"}}>
          <IconBrandFirebase size={24} strokeWidth={2} />
        </div>
      ),
    };

    return techStack.map((tech, index) => (
      <span key={index} className="icon">
        {skillIcons[tech]}
      </span>
    ));
  };
  return (
    <>
      <motion.div
        initial={{ opacity: 0, y: -100 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5, delay: 0.3 }}
        viewport={{ once: true }}
      >
        <div className="projects-container">
          {" "}
          <h2>My Projects</h2>
          {projectsData.map((project, index) => (
            <div className="project-card" key={index}>
              <div className="project-content">
                {project.image ? (
                  <img
                    src={project.image}
                    alt={project.title}
                    className="project-img"
                  />
                ) : (
                  <img
                    src="/images/placeholder.png"
                    className="project-img"
                    alt="Placeholder"
                  />
                )}
                <h4 className="project-title">{project.title}</h4>
                <div className="project-made-with">
                  {renderTechStackIcons(project.techStack)}
                </div>
                {project.academicProject ? (
                  <span className="project-academic">
                    <IconSchool /> Academic Project
                  </span>
                ) : (
                  ""
                )}
                <div className="project-description">
                  <p>{project.description}</p>
                </div>
                <div className="project-footer">
                  <div className="project-social-links">
                    <a href={project.githubLink}>
                      <IconBrandGithub />
                    </a>
                  </div>
                  <div className="project-external-link">
                    <a href={project.externalLink}>
                      <IconExternalLink />
                    </a>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      </motion.div>
    </>
  );
}

export default MyProjects;
